<html>
<head>
	<script type="text/javascript">
		var editor = 'https://test.draw.io/?dev=1&embed=1&spin=1&modified=0&proto=json';
		var temp = null;
		
		function edit(image)
		{
			var iframe = document.createElement('iframe');
			iframe.style.zIndex = '9999';
			iframe.style.position = 'absolute';
			iframe.style.top = '0px';
			iframe.style.left = '0px';
			iframe.setAttribute('frameborder', '0');

			var resize = function()
			{
				iframe.setAttribute('width', document.body.clientWidth);
				iframe.setAttribute('height', document.body.clientHeight);
			};
			
			var close = function()
			{
				window.removeEventListener('resize', resize);
				window.removeEventListener('message', receive);
				document.body.removeChild(iframe);
			};
			 
			window.addEventListener('resize', resize);
			resize();
			
			var receive = function(evt)
			{
				if (evt.data.length > 0)
				{
					var msg = JSON.parse(evt.data);
					
					if (msg.event == 'init')
					{
						iframe.contentWindow.postMessage(JSON.stringify({action: 'load',
							xmlpng: image.getAttribute('src')}), '*');
					}
					else if (msg.event == 'exit')
					{
						if (temp != null)
						{
							iframe.contentWindow.postMessage(JSON.stringify({action: 'export',
								format: 'xmlpng', xml: temp, spinKey: 'export'}), '*');
							temp = null;
						}
						else
						{
							close();
						}
					}
					else if (msg.event == 'export')
					{
						image.setAttribute('src', msg.data);
						close();
					}
					else if (msg.event == 'save')
					{
						temp = msg.xml;
						iframe.contentWindow.postMessage(JSON.stringify({action: 'status',
							resource: 'allChangesSaved', modified: false}), '*');
// 						iframe.contentWindow.postMessage(JSON.stringify({action: 'dialog',
// 							titleKey: 'error', messageKey: 'fileNotFound',
// 							buttonKey: 'close'}), '*');
					}
				}
			};

			window.addEventListener('message', receive);
			iframe.setAttribute('src', editor);
			document.body.appendChild(iframe);
		};
	</script>
</head>
